import React from 'react';
import { Link } from 'react-router-dom';
import './LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <main>
        <section className="hero-fiverr">
          <div className="hero-content">
            <h1>Find the right freelance service, right away</h1>
            <div className="search-bar">
              <input type="text" placeholder='Search for any service...' />
              <button>Search</button>
            </div>
            <div className="popular-tags">
              <span>Popular:</span>
              <Link to="/marketplace">Website Design</Link>
              <Link to="/marketplace">WordPress</Link>
              <Link to="/marketplace">Logo Design</Link>
              <Link to="/marketplace">AI Services</Link>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
};

export default LandingPage;
